function onFire() {
    module('apps.DateFormat').load(true)
    var n = Number(this.get('timesToRun').textString) || 1,
        source = this.get('codeText').textString;

    this.get('setupCodeText').evalAll();

    var t = new Date();
    console.profile('Benchmarker run')
    for (var i=0; i < n; i++)
        try { eval(source) } catch(e) { console.profileEnd(); throw e }
    console.profileEnd()
    var t2 = new Date();    

    var result = t2 - t;
    var former = this.get('benchmarkResults').textString;

    this.get('benchmarkResults').textString = result + 'ms (' + new Date().format('HH:MM:ss mm/dd/yy') + ')\n' + former;
}

